// SPDX-License-Identifier: MIT
pragma solidity ^0.8.2;

import "./IBEP20.sol";
import "./IMarketplace.sol";
import "./SafeMath.sol";
import "./Ownable.sol";
import "./AccessControl.sol";
import "./ERC721.sol";
import "./ERC721Pausable.sol";
import "./EnumerableSet.sol";
import "./EnumerableMap.sol";
import "./IPieceCore.sol";
import "./ReentrancyGuard.sol";

contract PieceCore is Ownable, ERC721Pausable, IPieceCore, ReentrancyGuard {
    using SafeMath for uint256;
    using EnumerableSet for EnumerableSet.UintSet;
    using EnumerableMap for EnumerableMap.UintToAddressMap;

    uint256 randNonce = 0;

    /*** DATA TYPES ***/
    struct Piece {
        uint256 tokenId; // current token id, theorically this will be the same as pieceId
        Rarity rarity;
        Rarity appearenceRarity;
        uint256 appearenceId;
        PieceType pieceType;
        uint64 birthTime; // The timestamp from the block when this Piece came into existence.
    }

    enum Rarity {
        E,
        D,
        C,
        B,
        A,
        S
    }

    enum PieceType {
        Head,
        LArm,
        RArm,
        Legs,
        Chest
    }

    enum PackageType {
        Default,
        First,
        Second,
        Third,
        Fourth
    }

    /*** STORAGE ***/
    /// @dev An array containing the Piece struct for all pieces in existence. The ID
    ///  of each Piece is actually an index into this array.
    Piece[] pieces;

    /* PACKAGE VARIABLES */
    mapping(Rarity => uint8) private _baseRarityPercentage;
    mapping(Rarity => uint8) private _box2RarityPercentage;
    mapping(Rarity => uint8) private _box3RarityPercentage;
    mapping(address => EnumerableSet.UintSet) private _contributorAppearenceIds;
    EnumerableMap.UintToAddressMap private _appearenceIdContributor;

    uint256 private nextPieceTokenId = 1;
    uint256 private piecePrice = 5 * 10**18; // to review

    /* SETTABLE VARIABLES */
    address public _mekaDeployerAddress;
    address public _piecePackageAddress;
    bool public _mekaDeployerEnabled;
    address public _mekaAddress;
    address public _marketplaceAddr;
    bool public isBurn;
    bool public isPieceFactoryOpen;

    event MintedPieceFromBundle(address from, uint256[] pieceId, uint256 date);

    constructor(address __mekaAddress) ERC721("Mekabot Piece", "MekaPiece") {
        isBurn = true;
        _mekaAddress = __mekaAddress;
        isPieceFactoryOpen = true;

        _baseRarityPercentage[Rarity.E] = 49;
        _baseRarityPercentage[Rarity.D] = 69;
        _baseRarityPercentage[Rarity.C] = 84;
        _baseRarityPercentage[Rarity.B] = 94;
        _baseRarityPercentage[Rarity.A] = 98;
        _baseRarityPercentage[Rarity.S] = 99;

        _box2RarityPercentage[Rarity.C] = 69;
        _box2RarityPercentage[Rarity.B] = 89;
        _box2RarityPercentage[Rarity.A] = 96;
        _box2RarityPercentage[Rarity.S] = 99;

        _box3RarityPercentage[Rarity.B] = 64;
        _box3RarityPercentage[Rarity.A] = 93;
        _box3RarityPercentage[Rarity.S] = 99;
    }

    function setContributorAppearenceId(
        address contributor,
        uint256 appearenceId
    ) external onlyOwner {
        require(
            !_appearenceIdContributor.contains(appearenceId),
            "appearenceId already has a contributor"
        );

        _contributorAppearenceIds[contributor].add(appearenceId);
        _appearenceIdContributor.set(appearenceId, contributor);
    }

    function setBaseRarity(Rarity rarity, uint8 percentage) external onlyOwner {
        _baseRarityPercentage[rarity] = percentage;
    }

    function setBox2Rarity(Rarity rarity, uint8 percentage) external onlyOwner {
        _box2RarityPercentage[rarity] = percentage;
    }

    function setBox3Rarity(Rarity rarity, uint8 percentage) external onlyOwner {
        _box3RarityPercentage[rarity] = percentage;
    }

    function setPiecePrice(uint256 _price) external onlyOwner {
        piecePrice = _price;
    }

    function setTokenAddress(address _addr) external onlyOwner {
        _mekaAddress = _addr;
    }

    function setTokenURI(uint256 tokenId, string memory _tokenURI)
        external
        onlyOwner
    {
        _setTokenURI(tokenId, _tokenURI);
    }

    function setPiecePackageAddress(address _address) external onlyOwner {
        _piecePackageAddress = _address;
    }

    // @dev Sets the reference to the sale.
    /// @param _address - Address of sale contract.
    function setMarketplaceAddress(address _address) external onlyOwner {
        _marketplaceAddr = _address;
    }

    function setMekaDeployerAddress(address _mekaDeployAddr)
        external
        onlyOwner
    {
        _mekaDeployerAddress = _mekaDeployAddr;
    }

    function updateMekaDeployerEnabled() external onlyOwner {
        _mekaDeployerEnabled = !_mekaDeployerEnabled;
    }

    // @dev Sets the reference to the burn.
    function updateIsBurn() external onlyOwner {
        isBurn = !isBurn;
    }

    function updatePieceFactory() external onlyOwner {
        isPieceFactoryOpen = !isPieceFactoryOpen;
    }

    modifier onlyBundle() {
        require(msg.sender == _piecePackageAddress, "not bundle");
        _;
    }

    modifier pieceFactory() {
        require(isPieceFactoryOpen, "piece factory closed");
        _;
    }

    modifier onlyMekaDeploy() {
        if (_mekaDeployerEnabled) {
            require(msg.sender == _mekaDeployerAddress, "not mekadeploy");
            _;
        } else {
            _;
        }
    }

    function withdrawBalance() external onlyOwner {
        IBEP20(_mekaAddress).transfer(owner(), getBalance());
    }

    function withdrawBnb() external onlyOwner {
        uint256 amount = address(this).balance;

        (bool success, ) = payable(owner()).call{value: amount}("");
        require(success, "Failed to send Ether");
    }

    function _mintPiece(
        address to,
        uint256 tokenId,
        uint256 appearenceId,
        Rarity rarity,
        Rarity appearenceRarity
    ) private {
        require(to != address(0), "ERC721: mint to the zero address");
        require(!_exists(tokenId), "ERC721: token already minted");

        Piece memory _piece = Piece({
            tokenId: tokenId,
            rarity: rarity,
            appearenceRarity: appearenceRarity,
            appearenceId: appearenceId,
            pieceType: PieceType(random(5)),
            birthTime: uint64(block.timestamp)
        });

        pieces.push(_piece);

        _safeMint(to, tokenId, "");

        emit Birth(to, tokenId, block.timestamp);

        emit Transfer(address(0), to, tokenId);
    }

    function createPiece(
        address _owner,
        uint256 _amount,
        uint256 appearenceId,
        string memory tokenURI
    ) external onlyMekaDeploy pieceFactory {
        require(_amount >= piecePrice, "INVALID AMOUNT");
        require(
            IBEP20(_mekaAddress).transferFrom(_owner, address(this), _amount)
        );

        uint256 tokenId = nextPieceTokenId;

        _mintPiece(
            _owner,
            tokenId,
            appearenceId,
            randomizeBaseRarity(),
            randomizeBaseRarity()
        );
        _setTokenURI(tokenId, tokenURI);

        nextPieceTokenId++;
    }

    function createSale(uint256 _tokenId, uint256 _startingPrice)
        external
        whenNotPaused
    {
        require(msg.sender == ownerOf(_tokenId), "Not tokenId owner");

        Piece memory piece = getPiece(_tokenId);

        _approve(_marketplaceAddr, _tokenId);
        IMarketplace(_marketplaceAddr).createSale(
            _tokenId,
            piece.appearenceId,
            _appearenceIdContributor.get(piece.appearenceId),
            _startingPrice,
            msg.sender
        );
    }

    function burnPiece(uint256 _tokenId) external pieceFactory {
        require(isBurn, "Burning is not allowed");
        require(tx.origin == ownerOf(_tokenId), "Not tokenId owner");

        _burn(_tokenId); // burn token
    }

    /// @notice Returns all the relevant information about a specific Piece.
    /// @param _id The ID of the Piece of interest.
    function getPiece(uint256 _id) public view returns (Piece memory piece) {
        piece = pieces[_id - 1];
    }

    function getBalance() public view returns (uint256) {
        return IBEP20(_mekaAddress).balanceOf(address(this));
    }

    function pause() external whenNotPaused onlyOwner {
        _pause();
    }

    function unpause() external whenPaused onlyOwner {
        _unpause();
    }

    function createPieceFromBundle(
        address _owner,
        uint8 packageType,
        uint8 pieceQuantity
    ) external onlyBundle pieceFactory {
        PackageType pkgType = PackageType(packageType);
        uint256[] memory allTokens = new uint256[](pieceQuantity);

        if (pkgType == PackageType.First) {
            for (uint256 index = 0; index < pieceQuantity; index++) {
                allTokens[index] = nextPieceTokenId;
                _mintPiece(
                    _owner,
                    nextPieceTokenId,
                    0,
                    randomizeBaseRarity(),
                    randomizeBaseRarity()
                );
                nextPieceTokenId++;
            }
        } else if (pkgType == PackageType.Second) {
            for (uint256 index = 0; index < pieceQuantity; index++) {
                allTokens[index] = nextPieceTokenId;
                _mintPiece(
                    _owner,
                    nextPieceTokenId,
                    0,
                    randomizeBox2Rarity(),
                    randomizeBaseRarity()
                );
                nextPieceTokenId++;
            }
        } else {
            for (uint256 index = 0; index < pieceQuantity; index++) {
                allTokens[index] = nextPieceTokenId;
                _mintPiece(
                    _owner,
                    nextPieceTokenId,
                    0,
                    randomizeBox3Rarity(),
                    randomizeBaseRarity()
                );
                nextPieceTokenId++;
            }
        }

        emit MintedPieceFromBundle(_owner, allTokens, block.timestamp);
    }

    function random(uint8 _modulus) private returns (uint256) {
        randNonce++;
        return
            uint256(
                keccak256(
                    abi.encodePacked(block.difficulty, msg.sender, randNonce)
                )
            ) % _modulus;
    }

    function randomizeBaseRarity() private returns (Rarity) {
        uint256 randNumber = random(100);

        if (randNumber <= _baseRarityPercentage[Rarity.E]) {
            return Rarity.E;
        } else if (randNumber <= _baseRarityPercentage[Rarity.D]) {
            return Rarity.D;
        } else if (randNumber <= _baseRarityPercentage[Rarity.C]) {
            return Rarity.C;
        } else if (randNumber <= _baseRarityPercentage[Rarity.B]) {
            return Rarity.B;
        } else if (randNumber <= _baseRarityPercentage[Rarity.A]) {
            return Rarity.A;
        } else {
            return Rarity.S;
        }
    }

    function randomizeBox2Rarity() private returns (Rarity) {
        uint256 randNumber = random(100);

        if (randNumber <= _box2RarityPercentage[Rarity.C]) {
            return Rarity.C;
        } else if (randNumber <= _box2RarityPercentage[Rarity.B]) {
            return Rarity.B;
        } else if (randNumber <= _box2RarityPercentage[Rarity.A]) {
            return Rarity.A;
        } else {
            return Rarity.S;
        }
    }

    function randomizeBox3Rarity() private returns (Rarity) {
        uint256 randNumber = random(100);

        if (randNumber <= _box3RarityPercentage[Rarity.B]) {
            return Rarity.B;
        } else if (randNumber <= _box3RarityPercentage[Rarity.A]) {
            return Rarity.A;
        } else {
            return Rarity.S;
        }
    }
}
